package main

import (
	"database/sql"
	"fmt"
	"log"
	"math/rand"
	"os"
	"time"

	_ "github.com/lib/pq"
)

func main() {
	connStr := os.Getenv("CONNSTR")

	db, err := sql.Open("postgres", connStr)
	if err != nil {
		log.Fatal(err)
	}
	defer db.Close()

	err = db.Ping()
	if err != nil {
		log.Fatal(err)
	}

	createTableSQL := `
        CREATE TABLE IF NOT EXISTS products (
            id SERIAL PRIMARY KEY,
            brand_name VARCHAR(255) NOT NULL,
            product_name VARCHAR(255) NOT NULL,
            category VARCHAR(255) NOT NULL,
            location VARCHAR(255) NOT NULL,
			image_url VARCHAR(5120) NOT NULL
        );`
	_, err = db.Exec(createTableSQL)
	if err != nil {
		log.Fatal(err)
	}

	brandProductPairs := generateBrandProductPairs(20)
	for _, pair := range brandProductPairs {
		insertSQL := "INSERT INTO products (brand_name, product_name, category, location, image_url) VALUES ($1, $2, $3, $4, $5)"
		_, err := db.Exec(insertSQL, pair.BrandName, pair.ProductName, pair.Category, randomLocation(), pair.ImageURL)
		if err != nil {
			log.Println("Error inserting record:", err)
		}
	}

	fmt.Println("Database seeded successfully!")
}


func randomLocation() string {
	locations := []string{"Los Angeles", "New York", "Seattle", "Dallas", "Miami"}
	return locations[randomInt(0, len(locations))]
}

func randomInt(min, max int) int {
	rand.Seed(time.Now().Unix())
	return rand.Intn(max-min) + min
}

