func generateBrandProductPairs(count int) []struct {
	BrandName   string
	ProductName string
	Category    string
	ImageURL    string
} {
	var pairs []struct {
		BrandName   string
		ProductName string
		Category    string
		ImageURL    string
	}

	for i := 0; i < count; i++ {
		randomPair := coffeeProductPairs[i]

		pair := struct {
			BrandName   string
			ProductName string
			Category    string
			ImageURL    string
		}{
			BrandName:   randomPair.BrandName,
			ProductName: randomPair.ProductName,
			Category:    randomPair.Category,
			ImageURL:    randomPair.ImageURL,
		}

		pairs = append(pairs, pair)
	}

	return pairs
}
